import Cards from "./Cards/Cards";
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Container from 'react-bootstrap/Container';
import Footer from './Footer/Footer';

function Home() {
    var cardStyle = {
      margin: "80px",
      padding: 0
    };

  return (
    <div>
        <Navbar bg="primary" variant="dark">
            <Container>
                <Navbar.Brand href="/">Job website</Navbar.Brand>
                <Nav className="me-auto">
                    <Nav.Link href="/">Home</Nav.Link>
                    <Nav.Link href="/about">About</Nav.Link>
                    <Nav.Link href="/contact">Contact</Nav.Link>
                    <Nav.Link href="/jobs">Jobs</Nav.Link>
                    <Nav.Link href="/companies">Company Showcase</Nav.Link>
                </Nav>
            </Container>
        </Navbar>

        <header className="py-5 bg-light border-bottom mb-4">
            <div className="container">
                <div className="text-center my-5">
                    <h1 className="fw-bolder">Welcome to Home!</h1>
                    <p className="lead mb-0">Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet</p>
                </div>
            </div>
        </header>

        {/* Your content goes here */}

        <Cards id="Home" style={cardStyle}></Cards>

        <Footer />
    </div>
  )
}

export default Home
